import React from 'react';
import './css/App.css';

import radiance from './assets/radiance.JPG';
import hackerrank from './assets/hackerrank.JPG';

const Works=()=>{

    const workTitle =[
        {
            id:1,
            title:"Radiance Competition Website",
            desc:"I had participated in Radiance Competition by PICT. During the event I had made this Website as a submission."
        },
        {
            id:2,
            title:"HackerRank Profile",
            desc:"In order to improve my JavaScript I joined HackerRank portal. There I had done programming in JavaScript and I got 4 stars for it. Check it out below."
        },
        {
            id:3,
            title:"Python Programs",
            desc:"I have programmed in python as well. And I have uploaded all the programs on github. You can checkout the code at my github page."
        }
    ]

    return (
        <div className="container mt-4 p-4">
      <center><span className="text-dark text-center head" >My Works</span></center>
      <div className="d-flex flex-column flex-md-row justify-content-md-evenly">

        <div className="card mb-2 card1">
          <img src={radiance} className="card-img-top" alt="..." />
          <div className="card-body">
            <h4 className="card-title" ></h4>
            <p className="card-text"></p>
          </div>
          <a href="https://shyam-lokhande.github.io/Radiance_Round_2/" target="_blank" rel="noreferrer" className="btn btn-dark">View Source</a>
        </div>
  
        <div className="card mb-2 card1" >
          <img src={hackerrank} className="card-img-top" alt="..." />
          <div className="card-body">
            <h4 className="card-title" ></h4>
          <p className="card-text"></p>
        </div>
        <a href="https://www.hackerrank.com/lokhandeshyam201" target="_blank" rel="noreferrer" className="btn btn-dark">View Source</a>
        </div>
      
        <div className="card mb-2 card1" >
          <img src="https://images.unsplash.com/photo-1487058792275-0ad4aaf24ca7?ixid=MnwxMjA3fDB8MHxzZWFyY2h8MjR8fHRlY2hub2xvZ3l8ZW58MHx8MHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=500&q=60" className="card-img-top" alt="..." />
          <div className="card-body">
            <h4 className="card-title" ></h4>
            <p className="card-text"></p>
          </div>
          <a href="https://github.com/shyam-lokhande/PythonProjects" target="_blank" rel="noreferrer" className="btn btn-dark">View Source</a>
        </div>
    
        
          
      </div>
    </div>
    );
};

export default Works;
